import "../App.css";
import React, { useEffect, useState } from "react";

function Test(props) {
  const delay = 1000;
  const [loadingVisible, setLoadingVisible] = useState(true);

  useEffect(() => {
    setTimeout(() => {
      setLoadingVisible(false);
    }, delay);
  }, []);

  return <div className="Test"></div>;
}

export default Test;
